/* eslint-disable react/react-in-jsx-scope */
import React from 'react';
import ReactDOM from 'react-dom';
import { Navbar, Nav, NavItem ,Form,FormControl,Button} from "react-bootstrap";
import { Router, Route, Link, browserHistory, IndexRoute } from 'react-router'

import Login from "./login";
import User from "./user";
function AppRouter() {
  return (
    <Nav className="mr-auto">
    <Nav.Link to={"login"} className=" m-2 btn btn-secondary"></Nav.Link>
    <Nav.Link to={"user"}  className=" m-2 btn btn-secondary"></Nav.Link>
    <Nav.Link href="about"  className="m-2 btn btn-secondary"></Nav.Link>
  </Nav>
  );
}
export default AppRouter;
